import React, { Component } from 'react'
import Logo from './Logo'
import Navbar from './Navbar'

export class Header extends Component {
    render() {
        return (
            <div className="header-container">
                <div className= "row">
                    <div className="col-4"></div>
                    <Logo></Logo>
                    <Navbar></Navbar>
                </div>
            </div>
        )
    }
}

export default Header
